import './App.css';
import Navbar from './Components/Navbar.js';
import {   BrowserRouter as Router ,
  Switch,
  Route,} from 'react-router-dom';
import Blog from './Components/Blog';
import Home from './Components/Home';

function App() {
  return (
    <Router>
        <Switch>
          <div className="App">
              <Navbar/>
          </div>


          <Route path="/">
            <Home />
          </Route>

          <Route path="/blog">
            <Blog />
          </Route>


      </Switch>
    </Router>


  );
}

export default App;
